import React from "react";
import { getAllPosts } from "../api";


const Posts = (props) => {
    console.log('in post', {props});
    const { posts, setPosts } = props;
    return (
        <div>
            <h1>Posts</h1>
            {
                posts.map(post => <div key={post._id}>
                    <div>
                        <h3>{post.title}</h3>
                        <p>{post.description}</p>
                        <p>{post.price}</p>
                        <p>{post.author.username}</p>
                    </div>
                </div>)
            }
        </div>
    )
}

export default Posts;
